import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Offcanvas from 'react-bootstrap/Offcanvas';
import Button from 'react-bootstrap/Button';
import "./navBar.css";
import Login from "./login.jsx";
function NavBar() {
    const [modalShow, setModalShow] = React.useState(false);

  return (
    <>
      {['lg'].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-transparent mb-3 fixed-top">
          <Container fluid>
            <Navbar.Brand href="/">Hospital</Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  Hospital
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3 d-flex ">
                  <Nav.Link href="/">Home</Nav.Link>
                  <Nav.Link href="Appointment">Appointment</Nav.Link>
                  <Nav.Link href="abort">Abort</Nav.Link>
                  <Button variant="outline-success" onclick ={() => setModalShow(true)}>Login</Button>
                  <Button variant="outline-success">Sign Up</Button>
                </Nav>
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
       <Login
        show={modalShow}
        onHide={() => setModalShow(false)}
      />

    </>
  );
}

export default NavBar;
